import { IconProp, SizeProp } from "@fortawesome/fontawesome-svg-core";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import React from "react";

type Tag = {
    name: string,
    icon: IconProp
    sizeIcon: SizeProp
}

export default function Tag (tag: Tag){
    return (<>
            <li className="w-40 px-1 rounded-full bg-slate-100 flex flex-row items-center justify-center text-ellipsis">
                <FontAwesomeIcon icon={tag.icon}  className="mx-1" size={tag.sizeIcon}  />
                    <p class="text-ellipsis overflow-hidden">{tag.name}</p>
            </li>
    </>)
}
